import React, { useState, useEffect } from "react";

export function City(data) {

    const city = data.title;
    
    let [getCity, setCity] = useState("Desconhecido!")
    
    function funCity() {
        setCity(city);
    }

    useEffect(funCity, []);
    
    return(
    <div>
        <p>{getCity}</p>
    </div>
    );
}
